import React from 'react';

const NavBar = () => {
	return (
		<header id='navbar'>
			<div>
				<img
					className='logo'
					src='airbnb-1.svg'
					alt='AirBnB'
				/>
			</div>
		</header>
	);
};

export default NavBar;
